import React from 'react'
import Card from './Card'
import data from "./data"
import { useNavigate } from "react-router-dom";
import './cards.css'
import returnData from "./choice"
// import { filter } from '@chakra-ui/react';


function PublicForm() {

  const navigate = useNavigate();

  let averagePrice = 0
  for (let i = 0; i < data.length; i++){
    averagePrice+= data[i].price
  }
  averagePrice = averagePrice / data.length
  let data1 = []
  let counter = 0
  for(let i = 0; i < data.length; i++) {
    if(data[counter].service !== data.cond) {
    data1.push(data[counter])
    counter+=1
    }
  }


    const cardsLeft = data1.map(item => {
      return (
        <Card 
        key = {item.id}
        {...item}
        />
      ) 
    })

    // const [cards, setCards] = React.useState(cardsLeft);


    // function filterItems(change) {
    //   const xd = data1.filter(function(item) {
    //     if(item.service === change){
    //       return item
    //     }
    //   setCards(xd)
    //   })
    // }

    const navToHome = () => {
      navigate("/");
  }

  const SearchBar = document.getElementById('SearchBar');
  let test
  SearchBar.addEventListener('keyUp', (event) => {
    const searchString = event.target.value
    const filteredCards = cardsLeft.filter(card => {
      return card.service.contain(searchString)
    })
    test = filteredCards.map(item => {
      return (
        <Card 
        key = {item.id}
        {...item}
        />
      )
    })
  })



  return <>
  <button onClick={navToHome}>Return Home</button>
  <form className='nav'>
    <label className='center'>Search Bar</label>
    <input name="SearchBar" placeholder="Specific Service" type="text"></input>
    <input type="submit" value="Submit"></input>
  </form>
  <div className='public-page'>
      <section className='cards-list'>
      {cardsLeft}
        {{test} ? {test} : {cardsLeft}}
      </section>
    </div>
    <h1 className='avg'>Average Cost of Service: {averagePrice}</h1>
  </>

}

export default PublicForm;
